import React from 'react'

const title = new String("Welcome to Sbrikki's Books");
const subtitle = new String("Join us in this Book Club for nights full of reading");

const Home = () => {
    return (
        <div className="home">
            <h1>{title}</h1>
            <h2>{subtitle}</h2>
        </div>
    )
}

export default Home
